{
    int i, j;
    for (i = 0; i <= 7; i++)
    {
        for (j = 0; j <= 7; j++)
        {
            plot_pixel(x - i, y - j, color);
            plot_pixel(x - i, y + j, color);
            plot_pixel(x + i, y - j, color);
            plot_pixel(x + i, y + j, color);
        }
    }
}
